package simulator

import (
	"encoding/json"
	"testing"

	"github.com/stretchr/testify/require"
	"gitlab.com/accumulatenetwork/accumulate/pkg/types/encoding"
	"gitlab.com/accumulatenetwork/accumulate/pkg/types/messaging"
	"golang.org/x/exp/rand"
)

func TestDeterministicMessageOrder(t *testing.T) {
	list := &encoding.JsonUnmarshalListWith[messaging.Message]{Func: messaging.UnmarshalMessageJSON}
	require.NoError(t, json.Unmarshal([]byte(messageData), list))

	sorted := list.Value
	orderMessagesDeterministically(sorted)

	for i := 0; i < 100; i++ {
		// Copy the array and shuffle it
		messages := make([]messaging.Message, len(sorted))
		copy(messages, sorted)
		rand.Shuffle(len(sorted), func(i, j int) {
			messages[i], messages[j] = messages[j], messages[i]
		})

		// Sort
		orderMessagesDeterministically(messages)

		// Verify the resulting order matches
		for i := range sorted {
			if !messaging.EqualMessage(sorted[i], messages[i]) {
				b, _ := json.Marshal(sorted[i])
				c, _ := json.Marshal(messages[i])
				require.Truef(t, false, "Mismatch at %d:\n%s\n%s", i, b, c)
			}
		}
	}
}

